import Property from "./Property";
import image1 from '../../assets/image1.jpeg';
import image2 from '../../assets/image2.jpeg';
import image3 from '../../assets/image3.jpeg';
import image4 from '../../assets/image4.jpeg';
import image5 from '../../assets/image5.jpeg'

const propertiesData = [
  { id: "1", address: "Madhapur Phase 2", image: image1, price: 3300000 },
  { id: "2", address: "Madhapur Phase 2", image: image2, price: 3300000 },
  { id: "3", address: "Madhapur Phase 2", image: image3, price: 3300000 },
  { id: "4", address: "Madhapur Phase 2", image: image4, price: 3300000 },
  { id: "5", address: "Madhapur Phase 2", image: image5, price: 3300000 },
];

const Properties = () => {
  return (
    <ul className="">
      {propertiesData.map((property) => {
        return (
          <Property
            key={property.id}
            address={property.address}
            image={property.image}
            price={property.price}
          />
        );
      })}
    </ul>
  );
};

export default Properties;
